    return(
        <div>
          <div className='cv-block'>
           <div className='cv-wrap'>
                {props.state?<h2 style={{marginTop:50}} className='cv-about'>გამოცდილება</h2>:null}
                <h5 className='cv-number'>{props.state} {props.state}</h5>
                <h6 className='cv-dates'>{props.state} {props.state}</h6>
                <p className='cv-paragraph'>{props.state}</p>
           </div>
       </div>

        </div>
    )
}
